import React from 'react'
import './Header.css'

function Header() {
    return (
        <nav className="header">
            <img className="header_logo" src="https://1000logos.net/wp-content/uploads/2019/07/Amazon-logo-2000%E2%80%93present.jpg"></img>
        </nav>
    )
}

export default Header
